import api from "../apis/api";

export const logIn = formValues => async dispatch => {
  // console.log(formValues);
  const response = await api.post('login', {email: formValues.email, password: formValues.password} );
  dispatch({
    type: 'LOG_IN',
    payload: response
  });
  console.log(response);
};
